def complement(sequence):    output = ''    # return the complementary sequence    for base in sequence:        if base == 'A':            output += 'T'        elif base == 'T':            output += 'A'        elif base == 'C':            output += 'G'        elif base == 'G':            output += 'C'        else:            output += '*'    return output        testseq = 'ATCGATCGATCGATCAAAAAAAAAAAAAAAA'complement_testseq = complement(testseq)print(complement_testseq)def reverse(reverse_word):    return reverse_word[::-1]test = "race car"word = reverse(test)print(word)def reverse_complement(seq):    seq=complement(seq)    seq=reverse(seq)    return seqtest_input = 'GATACAAAAAAAAAAAAAAA'test_reversed = reverse_complement(test_input)print(test_reversed)